import React from 'react';
import SearchBar from './SearchBar';
import WeatherCard from './WeatherCard';

class App extends React.Component {





	render() {
		return (
			<div className='ui container'>
				<div className='search'>
					<SearchBar />
				</div>
				<div className='weather'>
					<WeatherCard />
				</div>
			</div>
		)
	}
}

export default App;
